import Post from '../post/Post'
import './posts.css'

export default function Posts({posts, cats}) {
  // Filtre les elements brouillons
  return (
    <>
    {posts &&
      <div className="posts">
        { posts.map(e=> (
            <Post data={e} />
          ))
        }
      </div>
    }
    </>
  )
}
